import React from 'react';
import { FiBarChart2, FiShield, FiZap } from 'react-icons/fi';
import '../styles/FloatingCard.css';

const FloatingCard = ({ icon, title, description, delay = 0 }) => {
  const getIcon = () => {
    switch (icon) {
      case 'chart':
        return <FiBarChart2 />;
      case 'shield':
        return <FiShield />;
      case 'rocket':
        return <FiZap />;
      default:
        return <FiBarChart2 />;
    }
  };

  return (
    <div 
      className="floating-card"
      style={{ animationDelay: `${delay}s` }}
    >
      <div className="card-icon">
        {getIcon()}
      </div>
      <h4>{title}</h4>
      <p>{description}</p>
    </div>
  );
};

export default FloatingCard;
